import {Button} from 'react-bootstrap';

const About = ()=> (
    <Layout>
   
    <div>
       
       <h1> You can use the below filters </h1>
    
    <Button style={{margin:'10px'}}>Only Successful Launch</Button>
    <Button>2012</Button>
    
    </div>
  
    </Layout>
);

export default About;
